import React from 'react';
import { Col, Row, Button, Form, FormGroup, Label, Input, FormText, ListGroup, ListGroupItem } from 'reactstrap';

export default class Example extends React.Component {
  render() {
    return (
      <Form>
        <Row form>
          <Col md={6}>
            <FormGroup>
              <Label for="Playlist">Search</Label>
              <Input type="text" name="search" id="searchField" placeholder="Search for a song, album, or playlist" />
            </FormGroup>
          </Col>
        </Row>
        <Button id="search">Search</Button>
      </Form>

    );
  }
}
